import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-9baea478.js";const o={},r=t('<h1 id="农作物种子生产经营许可管理办法" tabindex="-1"><a class="header-anchor" href="#农作物种子生产经营许可管理办法" aria-hidden="true">#</a> 农作物种子生产经营许可管理办法</h1><p>（2016年7月8日农业部令2016年第5号公布，2017年11月30日农业部令2017年第8号、2019年4月25日农业农村部令2019年第2号、2020年7月8日农业农村部令第5号、2022年1月7日农业农村部令2022年第1号、2022年1月21日农业农村部令2022年第2号修订）</p><p></p><p>第一章 总  则</p><p></p><p>第一条　为加强农作物种子生产经营许可管理，规范农作物种子生产经营秩序，根据《中华人民共和国种子法》，制定本办法。</p><p>第二条　农作物种子生产经营许可证的申请、审核、核发和监管，适用本办法。</p><p>第三条　县级以上人民政府农业农村主管部门按照职责分工，负责农作物种子生产经营许可证的受理、审核、核发和监管工作。</p><p>第四条　负责审核、核发农作物种子生产经营许可证的农业农村主管部门，应当将农作物种子生产经营许可证的办理条件、程序等在办公场所公开。</p><p>第五条　农业农村主管部门应当按照保障农业生产安全、提升农作物品种选育和种子生产经营水平、促进公平竞争、强化事中事后监管的原则，依法加强农作物种子生产经营许可管理。</p><p></p><p>第二章 申请条件</p><p></p><p>第六条　申请领取种子生产经营许可证的企业，应当具有与种子生产经营相适应的设施、设备、品种及人员，符合本办法规定的条件。</p><p>第七条　申请领取主要农作物常规种子或非主要农作物种子生产经营许可证的企业，应当具备以下条件：</p><p>（一）基本设施。生产经营主要农作物常规种子的，具有办公场所150平方米以上、检验室100平方米以上、加工厂房500平方米以上、仓库500平方米以上；生产经营非主要农作物种子的，具有办公场所100平方米以上、检验室50平方米以上、加工厂房100平方米以上、仓库100平方米以上；</p><p>（二）检验仪器。具有净度分析台、电子秤、样品粉碎机、烘箱、生物显微镜、电子天平、扦样器、分样器、发芽箱等检验仪器，满足种子质量常规检测需要；</p><p>（三）加工设备。具有与其规模相适应的种子加工、包装等设备。其中，生产经营主要农作物常规种子的，应当具有种子加工成套设备，生产经营常规小麦种子的，成套设备总加工能力10吨/小时以上；生产经营常规稻种子的，成套设备总加工能力5吨/小时以上；生产经营常规大豆种子的，成套设备总加工能力3吨/小时以上；生产经营常规棉花种子的，成套设备总加工能力1吨/小时以上；</p><p>（四）人员。具有种子生产、加工贮藏和检验专业技术人员各2名以上；</p><p>（五）品种。生产经营主要农作物常规种子的，生产经营的品种应当通过审定，并具有1个以上与申请作物类别相应的审定品种；生产经营登记作物种子的，应当具有1个以上的登记品种。生产经营授权品种种子的，应当征得品种权人的书面同意；</p><p>（六）生产环境。生产地点无检疫性有害生物，并具有种子生产的隔离和培育条件；</p><p>（七）农业农村部规定的其他条件。</p><p>第八条　申请领取主要农作物杂交种子及其亲本种子生产经营许可证的企业，应当具备以下条件：</p><p>（一）基本设施。具有办公场所200平方米以上、检验室150平方米以上、加工厂房500平方米以上、仓库500平方米以上；</p><p>（二）检验仪器。除具备本办法第七条第二项规定的条件外，还应当具有PCR扩增仪及产物检测配套设备、酸度计、高压灭菌锅、磁力搅拌器、恒温水浴锅、高速冷冻离心机、成套移液器等仪器设备，能够开展种子水分、净度、纯度、发芽率四项指标检测及品种分子鉴定；</p><p>（三）加工设备。具有种子加工成套设备，生产经营杂交玉米种子的，成套设备总加工能力10吨/小时以上；生产经营杂交稻种子的，成套设备总加工能力5吨/小时以上；生产经营其他主要农作物杂交种子的，成套设备总加工能力1吨/小时以上；</p><p>（四）人员。具有种子生产、加工贮藏和检验专业技术人员各5名以上；</p><p>（五）品种。生产经营的品种应当通过审定，并具有自育品种或作为第一选育人的审定品种1个以上，或者合作选育的审定品种2个以上，或者受让品种权的品种3个以上。生产经营授权品种种子的，应当征得品种权人的书面同意；</p><p>（六）具有本办法第七条第六项规定的条件；</p><p>（七）农业农村部规定的其他条件。</p><p>第九条　申请领取实行选育生产经营相结合、有效区域为全国的种子生产经营许可证的企业，应当具备以下条件:</p><p>（一）基本设施。具有办公场所500平方米以上，冷藏库200平方米以上。生产经营主要农作物种子或马铃薯种薯的，具有检验室300平方米以上；生产经营其他农作物种子的，具有检验室200平方米以上。生产经营杂交玉米、杂交稻、小麦种子或马铃薯种薯的，具有加工厂房1000平方米以上、仓库2000平方米以上；生产经营棉花、大豆种子的，具有加工厂房500平方米以上、仓库500平方米以上；生产经营其他农作物种子的，具有加工厂房200平方米以上、仓库500平方米以上；</p><p>（二）育种机构及测试网络。具有专门的育种机构和相应的育种材料，建有完整的科研育种档案。生产经营杂交玉米、杂交稻种子的，在全国不同生态区有测试点30个以上和相应的播种、收获、考种设施设备；生产经营其他农作物种子的，在全国不同生态区有测试点10个以上和相应的播种、收获、考种设施设备；</p><p>（三）育种基地。具有自有或租用（租期不少于5年）的科研育种基地。生产经营杂交玉米、杂交稻种子的，具有分布在不同生态区的育种基地5处以上、总面积200亩以上；生产经营其他农作物种子的，具有分布在不同生态区的育种基地3处以上、总面积100亩以上；</p><p>（四）品种。生产经营主要农作物种子的，生产经营的品种应当通过审定，并具有相应作物的作为第一育种者的国家级审定品种3个以上，或者省级审定品种6个以上（至少包含3个省份审定通过），或者国家级审定品种2个和省级审定品种3个以上，或者国家级审定品种1个和省级审定品种5个以上。生产经营杂交稻种子同时生产经营常规稻种子的，除具有杂交稻要求的品种条件外，还应当具有常规稻的作为第一育种者的国家级审定品种1个以上或者省级审定品种3个以上。生产经营非主要农作物种子的，应当具有相应作物的以本企业名义单独申请获得植物新品种权的品种5个以上。生产经营授权品种种子的，应当征得品种权人的书面同意；</p><p>（五）生产规模。生产经营杂交玉米种子的，近3年年均种子生产面积2万亩以上；生产经营杂交稻种子的，近3年年均种子生产面积1万亩以上；生产经营其他农作物种子的，近3年年均种子生产的数量不低于该类作物100万亩的大田用种量；</p><p>（六）种子经营。具有健全的销售网络和售后服务体系。生产经营杂交玉米种子的，在申请之日前3年内至少有1年，杂交玉米种子销售额2亿元以上或占该类种子全国市场份额的1%以上；生产经营杂交稻种子的，在申请之日前3年内至少有1年，杂交稻种子销售额1.2亿元以上或占该类种子全国市场份额的1%以上；生产经营蔬菜种子的，在申请之日前3年内至少有1年，蔬菜种子销售额8000万元以上或占该类种子全国市场份额的1%以上；生产经营其他农作物种子的，在申请之日前3年内至少有1年，其种子销售额占该类种子全国市场份额的1%以上；</p><p>（七）种子加工。具有种子加工成套设备，生产经营杂交玉米、小麦种子的，总加工能力20吨/小时以上；生产经营杂交稻种子的，总加工能力10吨/小时以上（含窝眼清选设备）；生产经营大豆种子的，总加工能力5吨/小时以上；生产经营其他农作物种子的，总加工能力1吨/小时以上。生产经营杂交玉米、杂交稻、小麦种子的，还应当具有相应的干燥设备；</p><p>（八）人员。生产经营杂交玉米、杂交稻种子的，具有本科以上学历或中级以上职称的专业育种人员10人以上；生产经营其他农作物种子的，具有本科以上学历或中级以上职称的专业育种人员6人以上。生产经营主要农作物种子的，具有专职的种子生产、加工贮藏和检验专业技术人员各5名以上；生产经营非主要农作物种子的，具有专职的种子生产、加工贮藏和检验专业技术人员各3名以上；</p><p>（九）具有本办法第七条第六项、第八条第二项规定的条件；</p><p>（十）农业农村部规定的其他条件。</p><p>第十条　申请领取转基因农作物种子生产经营许可证的企业，应当具备下列条件：</p><p>（一）农业转基因生物安全管理人员2名以上；</p><p>（二）种子生产地点、经营区域在农业转基因生物安全证书批准的区域内；</p><p>（三）有符合要求的隔离和生产条件；</p><p>（四）有相应的农业转基因生物安全管理、防范措施；</p><p>（五）农业农村部规定的其他条件。</p><p>从事种子进出口业务、转基因农作物种子生产经营的企业和外商投资企业申请领取种子生产经营许可证，除具备本办法规定的相应农作物种子生产经营许可证核发的条件外，还应当符合有关法律、行政法规规定的其他条件。</p><p>第十一条　申请领取种子生产经营许可证，应当提交以下材料：</p><p>（一）种子生产经营许可证申请表（式样见附件1）；</p><p>（二）单位性质、股权结构等基本情况，公司章程、营业执照复印件，设立分支机构、委托生产种子、委托代销种子以及以购销方式销售种子等情况说明；</p><p>（三）种子生产、加工贮藏、检验专业技术人员和农业转基因生物安全管理人员的基本情况，企业法定代表人和高级管理人员名单及其种业从业简历；</p><p>（四）种子检验室、加工厂房、仓库和其他设施的自有产权或自有资产的证明材料；办公场所自有产权证明复印件或租赁合同；种子检验、加工等设备清单和购置发票复印件；相关设施设备的情况说明及实景照片；</p><p>（五）品种审定证书复印件；生产经营转基因农作物种子的，提交农业转基因生物安全证书复印件；生产经营授权品种种子的，提交植物新品种权证书复印件及品种权人的书面同意证明；</p><p>（六）委托种子生产合同复印件或自行组织种子生产的情况说明和证明材料；</p><p>（七）种子生产地点检疫证明；</p><p>（八）农业转基因生物安全管理、防范措施和隔离、生产条件的说明；</p><p>（九）农业农村部规定的其他材料。</p><p>第十二条　申请领取选育生产经营相结合、有效区域为全国的种子生产经营许可证，除提交本办法第十一条所规定的材料外，还应当提交以下材料：</p><p>（一）自有科研育种基地证明或租用科研育种基地的合同复印件；</p><p>（二）品种试验测试网络和测试点情况说明，以及相应的播种、收获、烘干等设备设施的自有产权证明复印件及实景照片；</p><p>（三）育种机构、科研投入及育种材料、科研活动等情况说明和证明材料，育种人员基本情况及其企业缴纳的社保证明复印件；</p><p>（四）近三年种子生产地点、面积和基地联系人等情况说明和证明材料；</p><p>（五）种子经营量、经营额及其市场份额的情况说明和证明材料；</p><p>（六）销售网络和售后服务体系的建设情况。</p><p></p><p>第三章 受理、审核与核发</p><p></p><p>第十三条　种子生产经营许可证实行分级审核、核发。</p><p>（一）从事主要农作物常规种子生产经营及非主要农作物种子经营的，其种子生产经营许可证由企业所在地县级以上地方农业农村主管部门核发；</p><p>（二）从事主要农作物杂交种子及其亲本种子生产经营以及实行选育生产经营相结合、有效区域为全国的种子企业，其种子生产经营许可证由企业所在地县级农业农村主管部门审核，省、自治区、直辖市农业农村主管部门核发；</p><p>（三）从事农作物种子进出口业务以及转基因农作物种子生产经营的，其种子生产经营许可证由农业农村部核发。</p><p>第十四条　农业农村主管部门对申请人提出的种子生产经营许可申请，应当根据下列情况分别作出处理：</p><p>（一）不需要取得种子生产经营许可的，应当即时告知申请人不受理；</p><p>（二）不属于本部门职权范围的，应当即时作出不予受理的决定，并告知申请人向有关部门申请；</p><p>（三）申请材料存在可以当场更正的错误的，应当允许申请人当场更正；</p><p>（四）申请材料不齐全或者不符合法定形式的，应当当场或者在五个工作日内一次告知申请人需要补正的全部内容，逾期不告知的，自收到申请材料之日起即为受理；</p><p>（五）申请材料齐全、符合法定形式，或者申请人按照要求提交全部补正申请材料的，应当予以受理。</p><p>第十五条　审核机关应当对申请人提交的材料进行审查，并对申请人的办公场所和种子加工、检验、仓储等设施设备进行实地考察，查验相关申请材料原件。</p><p>审核机关应当自受理申请之日起二十个工作日内完成审核工作。具备本办法规定条件的，签署审核意见，上报核发机关；审核不予通过的，书面通知申请人并说明理由。</p><p>第十六条　核发机关应当自受理申请或收到审核意见之日起二十个工作日内完成核发工作。核发机关认为有必要的，可以进行实地考察并查验原件。符合条件的，发给种子生产经营许可证并予公告；不符合条件的，书面通知申请人并说明理由。</p><p>选育生产经营相结合、有效区域为全国的种子生产经营许可证，核发机关应当在核发前在中国种业信息网公示五个工作日。</p><p></p><p>第四章 许可证管理</p><p></p><p>第十七条　种子生产经营许可证设主证、副证（式样见附件2）。主证注明许可证编号、企业名称、统一社会信用代码、住所、法定代表人、生产经营范围、生产经营方式、有效区域、有效期至、发证机关、发证日期；副证注明生产种子的作物种类、种子类别、品种名称及审定（登记）编号、种子生产地点等内容。</p><p>（一）许可证编号为“<strong>（××××）农种许字（××××）第××××号”。“</strong>”上标注生产经营类型，A为实行选育生产经营相结合，B为主要农作物杂交种子及其亲本种子，C为其他主要农作物种子，D为非主要农作物种子，E为种子进出口，F为外商投资企业，G为转基因农作物种子；第一个括号内为发证机关所在地简称，格式为“省地县”；第二个括号内为首次发证时的年号；“第××××号”为四位顺序号；</p><p>（二）生产经营范围按生产经营种子的作物名称填写，蔬菜、花卉、麻类按作物类别填写；</p><p>（三）生产经营方式按生产、加工、包装、批发、零售或进出口填写；</p><p>（四）有效区域。实行选育生产经营相结合的种子生产经营许可证的有效区域为全国。其他种子生产经营许可证的有效区域由发证机关在其管辖范围内确定；</p><p>（五）生产地点为种子生产所在地，主要农作物杂交种子标注至县级行政区域，其他作物标注至省级行政区域。</p><p>种子生产经营许可证加注许可信息代码。许可信息代码应当包括种子生产经营许可相关内容，由发证机关打印许可证书时自动生成。</p><p>第十八条　种子生产经营许可证载明的有效区域是指企业设立分支机构的区域。</p><p>种子生产地点不受种子生产经营许可证载明的有效区域限制，由发证机关根据申请人提交的种子生产合同复印件及无检疫性有害生物证明确定。</p><p>种子销售活动不受种子生产经营许可证载明的有效区域限制，但种子的终端销售地应当在品种审定、品种登记或标签标注的适宜区域内。</p><p>第十九条　种子生产经营许可证有效期为五年。转基因农作物种子生产经营许可证有效期不得超出农业转基因生物安全证书规定的有效期限。</p><p>在有效期内变更主证载明事项的，应当向原发证机关申请变更并提交相应材料，原发证机关应当依法进行审查，办理变更手续。</p><p>在有效期内变更副证载明的生产种子的品种、地点等事项的，应当在播种三十日前向原发证机关申请变更并提交相应材料，申请材料齐全且符合法定形式的，原发证机关应当当场予以变更登记。</p><p>种子生产经营许可证期满后继续从事种子生产经营的，企业应当在期满六个月前重新提出申请。</p><p>第二十条　在种子生产经营许可证有效期内，有下列情形之一的，发证机关应当注销许可证，并予以公告：</p><p>（一）企业停止生产经营活动一年以上的；</p><p>（二）企业不再具备本办法规定的许可条件，经限期整改仍达不到要求的。</p><p></p><p>第五章 监督检查</p><p></p><p>第二十一条　有下列情形之一的，不需要办理种子生产经营许可证：</p><p>（一）农民个人自繁自用常规种子有剩余，在当地集贸市场上出售、串换的；</p><p>（二）在种子生产经营许可证载明的有效区域设立分支机构的；</p><p>（三）专门经营不再分装的包装种子的；</p><p>（四）受具有种子生产经营许可证的企业书面委托生产、代销其种子的。</p><p>前款第一项所称农民，是指以家庭联产承包责任制的形式签订农村土地承包合同的农民；所称当地集贸市场，是指农民所在的乡（镇）区域。农民个人出售、串换的种子数量不应超过其家庭联产承包土地的年度用种量。违反本款规定出售、串换种子的，视为无证生产经营种子。</p><p>第二十二条　种子生产经营者在种子生产经营许可证载明有效区域设立的分支机构，应当在取得或变更分支机构营业执照后十五个工作日内向当地县级农业农村主管部门备案。备案时应当提交分支机构的营业执照复印件、设立企业的种子生产经营许可证复印件以及分支机构名称、住所、负责人、联系方式等材料（式样见附件3）。</p><p>第二十三条　专门经营不再分装的包装种子或者受具有种子生产经营许可证的企业书面委托代销其种子的，应当在种子销售前向当地县级农业农村主管部门备案，并建立种子销售台账。备案时应当提交种子销售者的营业执照复印件、种子购销凭证或委托代销合同复印件，以及种子销售者名称、住所、经营方式、负责人、联系方式、销售地点、品种名称、种子数量等材料（式样见附件4）。种子销售台账应当如实记录销售种子的品种名称、种子数量、种子来源和种子去向。</p><p>第二十四条　受具有种子生产经营许可证的企业书面委托生产其种子的，应当在种子播种前向当地县级农业农村主管部门备案。受委托生产转基因农作物种子的，应当有专门的管理人员和经营档案，有相应的安全管理、防范措施及国务院农业农村主管部门规定的其他条件。备案时应当提交委托企业的种子生产经营许可证复印件、委托生产合同，以及种子生产者名称、住所、负责人、联系方式、品种名称、生产地点、生产面积等材料（式样见附件5）。受托生产杂交玉米、杂交稻种子的，还应当提交与生产所在地农户、农民合作组织或村委会的生产协议。受委托生产转基因种子的，还应当提交转基因生物安全证书复印件。</p><p>第二十五条　种子生产经营者应当建立包括种子田间生产、加工包装、销售流通等环节形成的原始记载或凭证的种子生产经营档案，具体内容如下：</p><p>（一）田间生产方面：技术负责人，作物类别、品种名称、亲本（原种）名称、亲本（原种）来源，生产地点、生产面积、播种日期、隔离措施、产地检疫、收获日期、种子产量等。委托种子生产的，还应当包括种子委托生产合同。</p><p>（二）加工包装方面：技术负责人，品种名称、生产地点，加工时间、加工地点、包装规格、种子批次、标签标注，入库时间、种子数量、质量检验报告等。</p><p>（三）流通销售方面：经办人，种子销售对象姓名及地址、品种名称、包装规格、销售数量、销售时间、销售票据。批量购销的，还应包括种子购销合同。</p><p>种子生产经营者应当至少保存种子生产经营档案五年，确保档案记载信息连续、完整、真实，保证可追溯。档案材料含有复印件的，应当注明复印时间并经相关责任人签章。</p><p>第二十六条　种子生产经营者应当按批次保存所生产经营的种子样品，样品至少保存该类作物两个生产周期。</p><p>第二十七条　申请人故意隐瞒有关情况或者提供虚假材料申请种子生产经营许可证的，农业农村主管部门应当不予许可，并将申请人的不良行为记录在案，纳入征信系统。申请人在一年内不得再次申请种子生产经营许可证。</p><p>申请人以欺骗、贿赂等不正当手段取得种子生产经营许可证的，农业农村主管部门应当撤销种子生产经营许可证，并将申请人的不良行为记录在案，纳入征信系统。申请人在三年内不得再次申请种子生产经营许可证。</p><p>第二十八条　农业农村主管部门应当对种子生产经营行为进行监督检查，发现不符合本办法的违法行为，按照《中华人民共和国种子法》有关规定进行处理。</p><p>核发、撤销、吊销、注销种子生产经营许可证的有关信息，农业农村主管部门应当依法予以公布，并在中国种业信息网上及时更新信息。</p><p>对管理过程中获知的种子生产经营者的商业秘密，农业农村主管部门及其工作人员应当依法保密。</p><p>第二十九条　上级农业农村主管部门应当对下级农业农村主管部门的种子生产经营许可行为进行监督检查。有下列情形的，责令改正，对直接负责的主管人员和其他直接责任人依法给予行政处分；涉嫌犯罪的，及时将案件移送司法机关，依法追究刑事责任：</p><p>（一）未按核发权限发放种子生产经营许可证的；</p><p>（二）擅自降低核发标准发放种子生产经营许可证的；</p><p>（三）其他未依法核发种子生产经营许可证的。</p><p></p><p>第六章 附  则</p><p></p><p>第三十条　本办法所称种子生产经营，是指种植、采收、干燥、清选、分级、包衣、包装、标识、贮藏、销售及进出口种子的活动；种子生产是指繁（制）种的种植、采收的田间活动。</p><p>第三十一条　本办法所称种子加工成套设备，是指主机和配套系统相互匹配并固定安装在加工厂房内，实现种子精选、包衣、计量和包装基本功能的加工系统。主机主要包括风筛清选机（风选部分应具有前后吸风道，双沉降室；筛选部分应具有三层以上筛片）、比重式清选机和电脑计量包装设备；配套系统主要包括输送系统、储存系统、除尘系统、除杂系统和电控系统。</p><p>第三十二条　本办法规定的科研育种、生产、加工、检验、贮藏等设施设备，应为申请企业自有产权或自有资产，或者为其绝对控股子公司的自有产权或自有资产。办公场所应在种子生产经营许可证核发机关所辖行政区域，可以租赁。对申请企业绝对控股子公司的自有品种可以视为申请企业的自有品种。申请企业的绝对控股子公司不可重复利用上述办证条件申请办理种子生产经营许可证。</p><p>第三十三条　本办法所称不再分装的包装种子，是指按有关规定和标准包装的、不再分拆的最小包装种子。分装种子的，应当取得种子生产经营许可证，保证种子包装的完整性，并对其所分装种子负责。</p><p>有性繁殖作物的籽粒、果实，包括颖果、荚果、蒴果、核果等以及马铃薯微型脱毒种薯应当包装。无性繁殖的器官和组织、种苗以及不宜包装的非籽粒种子可以不包装。</p><p>种子包装应当符合有关国家标准或者行业标准。</p><p>第三十四条　申请领取鲜食、爆裂玉米的种子生产经营许可证的，按非主要农作物种子的许可条件办理。</p><p>第三十五条　生产经营无性繁殖的器官和组织、种苗、种薯以及不宜包装的非籽粒种子的，应当具有相适应的设施、设备、品种及人员，具体办法由省级农业农村主管部门制定，报农业农村部备案。</p><p>第三十六条　没有设立农业农村主管部门的行政区域，种子生产经营许可证由上级行政区域农业农村主管部门审核、核发。</p><p>第三十七条　种子生产经营许可证由农业农村部统一印制，相关表格格式由农业农村部统一制定。种子生产经营许可证的申请、受理、审核、核发和打印，以及种子生产经营备案管理，在中国种业信息网统一进行。</p><p>第三十八条　本办法自2016年8月15日起施行。农业部2011年8月22日公布、2015年4月29日修订的《农作物种子生产经营许可管理办法》（农业部令2011年第3号）和2001年2月26日公布的《农作物商品种子加工包装规定》（农业部令第50号）同时废止。</p><p>本办法施行之日前已取得的农作物种子生产、经营许可证有效期不变，有效期在本办法发布之日至2016年8月15日届满的企业，其原有种子生产、经营许可证的有效期自动延展至2016年12月31日。</p><p>本办法施行之日前已取得农作物种子生产、经营许可证且在有效期内，申请变更许可证载明事项的，按本办法第十三条规定程序办理。</p>',145),a=[r];function c(n,s){return _(),e("div",null,a)}const h=p(o,[["render",c],["__file","农作物种子生产经营许可管理办法.html.vue"]]);export{h as default};
